	('pimcore_document_2','O:27:\"Pimcore\\Model\\Document\\Page\":27:{s:5:\"title\";s:8:\"About Us\";s:11:\"description\";s:0:\"\";s:8:\"keywords\";s:0:\"\";s:8:\"metaData\";a:0:{}s:4:\"type\";s:4:\"page\";s:9:\"prettyUrl\";N;s:3:\"css\";s:0:\"\";s:8:\"personas\";s:0:\"\";s:6:\"module\";s:0:\"\";s:10:\"controller\";s:4:\"page\";s:6:\"action\";s:8:\"about-us\";s:8:\"template\";N;s:8:\"elements\";a:3:{s:15:\"about_us_header\";O:32:\"Pimcore\\Model\\Document\\Tag\\Image\":14:{s:2:\"id\";i:65;s:3:\"alt\";s:0:\"\";s:11:\"cropPercent\";N;s:9:\"cropWidth\";N;s:10:\"cropHeight\";N;s:7:\"cropTop\";N;s:8:\"cropLeft\";N;s:8:\"hotspots\";N;s:6:\"marker\";N;s:10:\"\0*\0options\";N;s:7:\"\0*\0name\";s:15:\"about_us_header\";s:11:\"\0*\0realName\";N;s:13:\"\0*\0documentId\";i:2;s:12:\"\0*\0inherited\";b:0;}s:13:\"about_us_info\";O:34:\"Pimcore\\Model\\Document\\Tag\\Wysiwyg\":6:{s:4:\"text\";s:1052:\"<p>Executive Care prides itself in delivering high quality, long and short term healthcare to more than 1100 residents across 25 homes throughout the UK.</p>\n\n<p>As an organisation, Executive Care believe in treating everyone as individuals and implement tailored care and support according to our residents\' needs and wishes by actively involving them and their families in care decisions. We listen and react to feedback to ensure that every day is a meaningful and memorable one and also to empower a sense of independence.</p>\n\n<p>The organisation is led by a dynamic senior management team who are genuinely passionate about the delivery of high quality, person-centred care to improve the health and well-being of our residents whose families entrust us with their care.</p>\n\n<p>The team has a diverse skill-set and wealth of knowledge and experience of the care sector, which they apply through a leadership style that reflects the behaviours we wish our staff to display in their everyday actions with residents, relatives and communities.</p>\n\";s:10:\"\0*\0options\";N;s:7:\"\0*\0name\