	('pimcore_document_4','O:27:\"Pimcore\\Model\\Document\\Page\":27:{s:5:\"title\";s:8:\"Our Care\";s:11:\"description\";s:0:\"\";s:8:\"keywords\";s:0:\"\";s:8:\"metaData\";a:0:{}s:4:\"type\";s:4:\"page\";s:9:\"prettyUrl\";N;s:3:\"css\";s:0:\"\";s:8:\"personas\";s:0:\"\";s:6:\"module\";s:0:\"\";s:10:\"controller\";s:4:\"page\";s:6:\"action\";s:8:\"our-care\";s:8:\"template\";N;s:8:\"elements\";a:12:{s:12:\"contentblock\";O:32:\"Pimcore\\Model\\Document\\Tag\\Block\":8:{s:7:\"indices\";a:4:{i:0;s:1:\"1\";i:1;s:1:\"2\";i:2;s:1:\"3\";i:3;s:1:\"4\";}s:7:\"current\";i:0;s:8:\"suffixes\";a:0:{}s:10:\"\0*\0options\";N;s:7:\"\0*\0name\";s:12:\"contentblock\";s:11:\"\0*\0realName\";N;s:13:\"\0*\0documentId\";i:4;s:12:\"\0*\0inherited\";b:0;}s:20:\"contentcontentblock1\";O:34:\"Pimcore\\Model\\Document\\Tag\\Wysiwyg\":6:{s:4:\"text\";s:1255:\"<h2>What is residential care?</h2>\n\n<p>The term residential care refers to the delivery of \'personal care\' within a residential setting. It is for those who can no longer manage living on their own even with assistance from home care agencies or relatives.</p>\n\n<h2>What does Executive Care provide?</h2>\n\n<p>There are many reasons why residential care may be needed. Clients can expect a tailored care plan to suit their individual needs and requirements to help maintain as high a level of independence as possible.</p>\n\n<p>Residents can&nbsp;expect 24 hour assistance with the following:</p>\n\n<ul>\n	<li>Washing &amp; bathing</li>\n	<li>Dressing</li>\n	<li>Getting in and out of bed</li>\n	<li>Eating meals</li>\n	<li>Using the bathroom</li>\n	<li>Taking Medication</li>\n	<li>Making drinks and snacks</li>\n</ul>\n\n<p>&nbsp;</p>\n\n<p>The above are just a few types of the help that Executive Care provides. Residents can expect to live in a comfortable environment where they can feel at home, have their meals freshly prepared and laundry and cleaning taken care of. Above all, carers are there not just to deliver personal care, but to support our residents\' social and emotional needs, so their lives are enhanced instead of feeling lonely or isolated..</p>\n\";s:10:\"\0*\0options\";N;s:7:\"\0*\0name\";s:20:\"contentcontentblock1\";s:11:\"\0*\0realName\";N;s:13:\"\0*\0documentId\";i:4;s:12:\"\0*\0inherited\";b:0;}s:20:\"contentcontentblock2\";O:34:\"Pimcore\\Model\\Document\\Tag\\Wysiwyg\":6:{s:4:\"text\";s:1316:\"<h2>What is nursing care?</h2>\n\n<p>Nursing care is the same in its approach&nbsp;as residential care, with the additional benefit of round-the-clock&nbsp;assistance from a qualified nurse. Those who have spent long periods in hospital are usually assessed as needing nursing care.</p>\n\n<h2>What does Executive Care provide?</h2>\n\n<p>Executive care nurses&nbsp;are fully qualified and trained in the provision of elderly care. Clients can expect a detailed care plan which is tailored specifically to suit our clients\' medical needs to help maintain as high a level of independence as possible.</p>\n\n<p>Residents can expect 24 hour assistance with the following:</p>\n\n<ul>\n	<li>Washing &amp; bathing</li>\n	<li>Dressing</li>\n	<li>Getting in and out of bed</li>\n	<li>Eating meals</li>\n	<li>Using the bathroom</li>\n	<li>Taking Medication</li>\n	<li>Making drinks and snacks</li>\n</ul>\n\n<p>The above are just a few types of the help that Executive Care gives. Residents can expect to live in comfortable environment where they can feel at home, have their meals freshly prepared and laundry and cleaning taken care of. Above all, carers and nurses are there not just to deliver personal care, but to support our residents\' social and emotional needs, so their lives are enhanced instead of feeling lonely or isolated.</p>\n\";s:10:\"\0*\0options\";N;s:7:\"\0*\0name\";s:20:\"contentcontentblock2\";s:11:\"\0*\0realName\";N;s:13:\"\0*\0documentId\";i:4;s:12:\"\0*\0inherited\";b:0;}s:20:\"contentcontentblock3\";O:34:\"Pimcore\\Model\\Document\\Tag\\Wysiwyg\":6:{s:4:\"text\";s:2550:\"<h2>What is dementia?</h2>\n\n<p>The term dementia is a broad term used to describe a range of symptoms that can occur when the brain is affected by specific diseases and neurological conditions. These include, Alzheimers disease, vascular disease, Lewy Bodies and Frontal Temporal Dementia, Huntingtons disease, Picks disease, Parkinsons disease.&nbsp;&nbsp; The diseases and conditions that cause dementia are progressive and this means that the symptoms will get worse over time.&nbsp; The presence of dementia symptoms will vary depending on the disease process and how these impacts on the individual so each persons experience of dementia will be different.</p>\n\n<h2>What are the challenges of caring for someone with dementia?</h2>\n\n<p>Symptoms will usually have been present for at least 6 months with the possibility of the cause of these being as a result of an underlying treatable condition ruled out prior to a diagnosis of a dementia being confirmed.&nbsp; These symptoms are as a result of the changes that are occurring in the brain and may include loss of memory for familiar names, faces and places. The parts of the brain that control emotions and mood can be affected by the disease as can language which can affect a persons ability to talk, read or write.</p>\n\n<h2>What does Executive Care provide?</h2>\n\n<p>At Executive Care Group, we recognise that many factors influence the course and experience of dementia, not least the influence of the quality of care and support and the environment in which it is provided.&nbsp; Our approach seeks to maintain for as long as possible the individuals skills and abilities that enhance well being and individual autonomy for the person.&nbsp;</p>\n\n<p>Emphasis is given to seeing and knowing the person living with dementia because it is only by truly seeing and knowing the individual that we can recognise and respond to their needs. This is achieved through the mutual support and benefits that are derived from the shared care relationship developed with relatives and friends of the person with dementia.</p>\n\n<p>By listening, accepting and understanding the past and present experience of the person with dementia, we can help to maintain the individuals sense of self, and of being valued as a person.&nbsp; This knowledge can help minimise some of the stress and anxiety the symptoms of dementia cause by providing a means of diverting attention onto more comforting thoughts or activity to alleviate any distress and enhance well-being.</p>\n\";s:10:\"\0*\0options\";N;s:7:\"\0*\0name\";s:20:\"contentcontentblock3\";s:11:\"\0*\0realName\";N;s:13:\"\0*\0documentId\";i:4;s:12:\"\0*\0inherited\";b:0;}s:20:\"contentcontentblock4\";O:34:\"Pimcore\\Model\\Document\\Tag\\Wysiwyg\":6:{s:4:\"text\";s:1487:\"<p>As well as Elderly Care, Executive Care also specialises in the provision of long term healthcare for young people and adults, aged 18+, with physical and/or learning disabilities.</p>\n\n<p>People with physical and&nbsp;learning disabilities have their own specific needs; Executive Care aim to support development and positive life experiences through person-centred planning and review. An empowering and inclusive approach is integral to our bespoke model of&nbsp;personal&nbsp;service delivery.</p>\n\n<p>Throughout our specialist care homes, we are able to support people with mild, moderate or severe learning disabilities, who may have;</p>\n\n<ul>\n	<li>Conditions spanning the autistic spectrum</li>\n	<li>Co-presenting mental health problems</li>\n	<li>Personality disorder</li>\n	<li>Physical disabilities</li>\n	<li>Complex needs</li>\n</ul>\n\n<p>Homes that exclusively cater for this care category are:&nbsp;<a href=\"http://www.execcaregroup.co.uk/index.php?page=conifer-lodge\">Conifer Lodge</a>,&nbsp;<a href=\"http://www.execcaregroup.co.uk/index.php?page=evergreens-care-home\">Evergreens Care Home</a>,&nbsp;<a href=\"http://www.execcaregroup.co.uk/index.php?page=heather-house\">Heather House</a>,&nbsp;<a href=\"http://www.execcaregroup.co.uk/index.php?page=pembroke-lodge\">Pembroke Lodge</a>&nbsp;and&nbsp;<a href=\"http://www.execcaregroup.co.uk/index.php?page=sovereign-court\">Sovereign Court</a>. Each of these homes have facilities&nbsp;to suit a range of healthcare needs.</p>\n\";s:10:\"\0*\0options\";N;s:7:\"\0*\0name\";s:20:\"contentcontentblock4\";s:11:\"\0*\0realName\";N;s:13:\"\0*\0documentId\";i:4;s:12:\"\0*\0inherited\";b:0;}s:15:\"our-care_header\";O:32:\"Pimcore\\Model\\Document\\Tag\\Image\":14:{s:2:\"id\";N;s:3:\"alt\";s:0:\"\";s:11:\"cropPercent\";N;s:9:\"cropWidth\";N;s:10:\"cropHeight\";N;s:7:\"cropTop\";N;s:8:\"cropLeft\";N;s:8:\"hotspots\";N;s:6:\"marker\";N;s:10:\"\0*\0options\";N;s:7:\"\0*\0name\";s:15:\"our-care_header\";s:11:\"\0*\0realName\";N;s:13:\"\0*\0documentId\";i:4;s:12:\"\0*\0inherited\";b:0;}s:13:\"our-care_info\";O:34:\"Pimcore\\Model\\Document\\Tag\\Wysiwyg\":6:{s:4:\"text\";s:771:\"<p>Executive Care\'s vision is to provide comfortable homes of the highest standards and specificatiosn to improve the quality of life for the individuals and families whom entrust us with their care.</p>\n\n<p>To fulfil this purpose, we profoundly beleive that our programme of life-enahancing and meaningful activities developed through and inclusive person-centred planning process will deliver real quality improvements on day to day life.</p>\n\n<p>We consistently deliver out quality driven setvices within our elderly, nursing, dementia and specialist homes through a highly and appropriately skilled workforce. We aim to recruit the right people , and develop and support them through training and leadership so that they can make a positive difference to others.</p>\n\";s:10:\"\0*\0options\";N;s:7:\"\0*\0name\";s:13:\"our-care_info\";s:11:\"\0*\0realName\";N;s:13:\"\0*\0documentId\";i:4;s:12:\"\0*\0inherited\";b:0;}s:5:\"title\";O:32:\"Pimcore\\Model\\Document\\Tag\\Input\":6:{s:4:\"text\";s:8:\"Our care\";s:10:\"\0*\0options\";N;s:7:\"\0*\0name\";s: