;a:1:{i:0;s:8:\"Brochure\";}s:11:\"o_published\";b:1;s:4:\"o_id\";i:46;s:10:\"o_parentId\";i:44;s:6:\"o_type\";s:6:\"object\";s:5:\"o_key\";s:21:\"abbeyvale-care-centre\";s:6:\"o_path\";s:11:\"/carehomes/\";s:7:\"o_index\";i:0;s:14:\"o_creationDate\";i:1442399921;s:18:\"o_modificationDate\";i:1447419896;s:11:\"o_userOwner\";i:2;s:18:\"o_userModification\";i:2;s:10:\"o_siblings\";N;s:13:\"o_hasSiblings\";N;s:8:\"o_locked\";N;s:19:\"o_elementAdminStyle\";N;s:24:\"____pimcore_cache_item__\";s:17:\"pimcore_object_46\";}}s:13:\"contractHours\";i:42;s:13:\"contractShift\";s:11:\"Continental\";s:12:\"contractType\";s:9:\"Part-Time\";s:11:\"closingDate\";O:12:\"Pimcore\\Date\":8:{s:18:\"\0Zend_Date\0_locale\";s:5:\"en_US\";s:22:\"\0Zend_Date\0_fractional\";i:0;s:21:\"\0Zend_Date\0_precision\";i:3;s:36:\"\0Zend_Date_DateObject\0_unixTimestamp\";s:10:\"1479859200\";s:31:\"\0Zend_Date_DateObject\0_timezone\";s:13:\"Europe/Berlin\";s:29:\"\0Zend_Date_DateObject\0_offset\";i:-3600;s:34:\"\0Zend_Date_DateObject\0_syncronised\";i:0;s:7:\"\0*\0_dst\";b:1;}s:8:\"reportTo\";s:12:\"Home Manager\";s:7:\"purpose\";s:81:\"Cooking high quality food for residents with a variety of different dietary needs\";s:28:\"skillsKnoweldgeQualification\";s:453:\"<p>Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum.</p>\n\";s:20:\"mainResponsibilities\";s:3881:\"<p><strong>Activities:&nbsp;</strong></p>\n\n<ol>\n	<li>\n	<p>Help Clients to socialise within the Care Centre, and provide a variety of activities that cater for all tastes.&nbsp;</p>\n	</li>\n	<li>\n	<p>Plan and initiate monthly rolling / individual programmes, and encourage Clients to maintain pre-existing hobbies.&nbsp;</p>\n	</li>\n	<li>\n	<p>Encourage Staff Members, Relatives and Friends to participate in the Care Centre&#39;s activities.&nbsp;</p>\n	</li>\n	<li>\n	<p>Accompany Clients, where possible, to off-site activities, which may occasionally take place outwith normal working hours.&nbsp;</p>\n	</li>\n	<li>\n	<p>Help to create an atmosphere that suits individual Clients within the Care Centre.&nbsp;</p>\n	</li>\n	<li>\n	<p>Assist with fund raising, and budgeting, for entertainments, materials and outings.&nbsp;</p>\n	</li>\n	<li>\n	<p>Maintain full and accurate records of daily activities using appropriate documentation, and assist the Named Carer to review and update Client Care Files.&nbsp;</p>\n	</li>\n</ol>\n\n<p>&nbsp;</p>\n\n<p><strong>Communication:&nbsp;</strong></p>\n\n<ol>\n	<li>\n	<p>Discuss the aims and objectives of recreation therapy with other Staff Members.&nbsp;</p>\n	</li>\n	<li>\n	<p>Report any changes in Clients&#39; physical or emotional condition to the Home Manager or Person in Charge.&nbsp;</p>\n	</li>\n	<li>\n	<p>Provide comfort and company, on a one to one basis, for Clients who are unable to undertake any form of activity.&nbsp;</p>\n	</li>\n	<li>\n	<p>Arrange / participate in Staff and Client meetings, as and when required.&nbsp;</p>\n	</li>\n</ol>\n\n<p><strong>Human Resources (HR):&nbsp;</strong></p>\n\n<ol>\n	<li>\n	<p>Assist the Home Manager when interviewing relevant Volunteers and assistant Staff Members, and supervise their work, in line with the Company&rsquo;s policies and procedures.&nbsp;</p>\n	</li>\n</ol>\n\n<p>&nbsp;</p>\n\n<p><strong>Marketing:&nbsp;</strong></p>\n\n<ol>\n	<li>\n	<p>Actively market the Care Centre and promote a positive personal / professional profile within the local community, ensuring the good reputation of the Care Centre at all times.&nbsp;</p>\n	</li>\n</ol>\n\n<p>&nbsp;</p>\n\n<p><strong>Training &amp; Development:&nbsp;</strong></p>\n\n<ol>\n	<li>\n	<p>Ensure all Staff Members know how to use appropriate equipment.&nbsp;</p>\n	</li>\n	<li>\n	<p>Attend mandatory training days/courses, on or off site, as and when required.&nbsp;</p>\n	</li>\n	<li>\n	<p>Maintain professional knowledge and competence.&nbsp;</p>\n	</li>\n</ol>\n\n<p>&nbsp;</p>\n\n<p><strong>Health &amp; Safety:&nbsp;</strong></p>\n\n<ol>\n	<li>\n	<p>Report immediately to the Home Manager, or Person in Charge, any illness of an infectious nature or accident incurred by a Client, colleague, self or another.&nbsp;</p>\n	</li>\n	<li>\n	<p>Understand and ensure the implementation of the Care Centre&rsquo;s Health and Safety policy, and Emergency and Fire procedures.&nbsp;</p>\n	</li>\n	<li>\n	<p>Report to the Home Manager, or the Handyperson, any faulty appliances, damaged furniture, equipment or any potential hazard.&nbsp;</p>\n	</li>\n	<li>\n	<p>Promote safe working practice in the Care Centre.&nbsp;</p>\n	</li>\n</ol>\n\n<p>&nbsp;</p>\n\n<p><strong>General:&nbsp;</strong></p>\n\n<ol>\n	<li>\n	<p>Ensure that all information of confidential nature gained in the course of duty is not divulged to third parties.&nbsp;</p>\n	</li>\n	<li>\n	<p>Notify the Home Manager, or the Person in Charge, as soon as possible of your inability to work, and also on your return to work from all periods of absence.&nbsp;</p>\n	</li>\n	<li>\n	<p>Ensure the security of the Care Centre is maintained at all times.&nbsp;</p>\n	</li>\n	<li>\n	<p>Adhere to all Company policies and procedures within the defined timescales.&nbsp;</p>\n	</li>\n	<li>\n	<p>Ensure all equipment is clean and well maintained.&nbsp;</p>\n	</li>\n	<li>\n	<p>Carry out any other tasks that may be reasonably assigned to you.&nbsp;</p>\n	</li>\n</ol>\n\";s:16:\"lazyLoadedFields\";a:1:{i:0;s:15:\"applicationForm\";}s:11:\"o_published\";b:1;s:4:\"o_id\";i:153;s:10:\"o_parentId\";i:67;s:6:\"o_type\";s:6:\"object\";s:5:\"o_key\";s:14:\"chef-abbeyvale\";s:6:\"o_path\";s:9:\"/vacancy/\";s:7:\"o_index\";i:0