	(1,'recommendation-content','wysiwyg','<p>09 Jun 2015 by Angie King Wife of Resident/Service User</p>\n\n<p>My husband Terry, has been in the home for over a year now and has been happy since day 1. The staff are wonderful and really do care. I am... continue reading.</p>\n'),
