	(40,'thankyouDesc','wysiwyg','<p>Thank you for subscribing to our job alerts email. You will receive and email form us when we post a job on our website in your selected location.</p>\n\n<p>Should you wish to unsubscribe from these emails, please click the&nbsp;<strong>unsubcribe me&nbsp;</strong>link on the foot of your email, and we will remove you from our database.&nbsp;</p>\n\n<p>To complete the process, please click the link in the email we have just sent you, to confirm you would like to receive our emails</p>\n'),
