INSERT INTO `search_backend_data` (`id`, `fullpath`, `maintype`, `type`, `subtype`, `published`, `creationDate`, `modificationDate`, `userOwner`, `userModification`, `data`, `properties`)
VALUES
	(1,'/','document','page','page',1,1436967813,1444313147,1,2,'ID: 1  \nPath: /  \nFIND A HOME Use our interactive search tool to find an Executive Care home near you. Enter your postcode, town or city below: asset: /homepage-header.jpgasset: /header_1.jpgasset: /header_2.jpgasset: /header_3.jpgasset: /header_4.jpgasset: /header_5.jpgasset: /header_6.jpg NEWS &amp; EVENTS Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore. Preparing to place a loved one into care can be a complicated process. We can help you get past the jargon. OUR CARE, EXPLAINED Preparing to place a loved one into care can be a complicated process. We can help you get past the jargon. Our care, explained 09 Jun 2015 by Angie King Wife of Resident/Service User My husband Terry, has been in the home for over a year now and has been happy since day 1. The staff are wonderful and really do care. I am... continue reading. Recommendation for The Squirrels WORK FOR EXECUTIVE CARE We are always on the lookout for motivated individuals with a real passion for care delivery. Home ','navigation_title:Home navigation_target: navigation_name:Home navigation_exclude: language: '),
	(2,'/about-us','document','page','page',1,1437383399,1447697094,2,9,'ID: 2  \nPath: /about-us  \n Executive Care prides itself in delivering high quality, long and short term healthcare to more than 1100 residents across 25 homes throughout the UK. As an organisation, Executive Care believe in treating everyone as individuals and implement tailored care and support according to our residents\' needs and wishes by actively involving them and their families in care decisions. We listen and react to feedback to ensure that every day is a meaningful and memorable one and also to empower a sense of independence. The organisation is led by a dynamic senior management team who are genuinely passionate about the delivery of high quality, person-centred care to improve the health and well-being of our residents whose families entrust us with their care. The team has a diverse skill-set and wealth of knowledge and experience of the care sector, which they apply through a leadership style that reflects the behaviours we wish our staff to display in their everyday actions with residents, relatives and communities. Lorem ipsum dolor sit amet, aperiam gubergren vim ei, ex usu imperdiet moderatius. Solet tation urbanitas at mel. Elit evertitur mel te. Essent constituam duo ei. Dolores expetenda mea at. Ius virtute omittantur te. Duo te idque corrumpit, cum at ipsum tractatos. Cum scripta virtute at, mel at quidam aperiam, cu duo minimum euripidis. Te eum graeci audiam. Has ignota voluptatum adversarium at, sed ad clita iriure saperet, ne quidam nostro integre vis. Sale partem qualisque pri an, ne nec liber veniam sapientem, at quaeque commune nam. Ea modo altera vix, sed eirmod molestiae an. Copiosae interpretaris mei at, has at agam nemore vocent. Te erant iuvaret philosophia quo, sit congue soleat referrentur an. Per id decore eruditi philosophia, consul impedit molestie has et, sonet verear discere ad his. Sea ex laudem dolores scripserit, per etiam offendit te. Cu nobis scripta ius. Ius alia alterum no, mutat probatus an his, movet dicit per at. Solum causae invidunt sea ei, enim euismod recusabo nec no. No mel vide aeque, in elit disputationi vel, qui an dico deterruisset. Et minim impetus consequat vis. Sed numquam voluptua honestatis cu, congue platonem contentiones quo an, has at senserit convenire. Audire suscipit an sea. At aperiam molestiae usu, mel et erat libris. About Us ','language: navigation_title: navigation_target: navigation_exclude: navigation_name:About Us '),
	(2,'/blog','object','folder','folder',1,1438790792,1438790792,2,2,'ID: 2  \nPath: /blog  \nblog',''),
	(3,'/blog/entries','object','folder','folder',1,1438790792,1438790792,2,2,'ID: 3  \nPath: /blog/entries  \nentries',''),
	(4,'/our-care','document','page','page',1,1437383581,1448036929,2,9,'ID: 4  \nPath: /our-care  \n What is residential care? The term residential care refers to the delivery of \'personal care\' within a residential setting. It is for those who can no longer manage living on their own even with assistance from home care agencies or relatives. What does Executive Care provide? There are many reasons why residential care may be needed. Clients can expect a tailored care plan to suit their individual needs and requirements to help maintain as high a level of independence as possible. Residents can&nbsp;expect 24 hour assistance with the following: Washing &amp; bathing Dressing Getting in and out of bed Eating meals Using the bathroom Taking Medication Making drinks and snacks &nbsp; The above are just a few types of the help that Executive Care provides. Residents can expect to live in a comfortable environment where they can feel at home, have their meals freshly prepared and laundry and cleaning taken care of. Above all, carers are there not just to deliver personal care, but to support our residents\' social and emotional needs, so their lives are enhanced instead of feeling lonely or isolated.. What is nursing care? Nursing care is the same in its approach&nbsp;as residential care, with the additional benefit of round-the-clock&nbsp;assistance from a qualified nurse. Those who have spent long periods in hospital are usually assessed as needing nursing care. What does Executive Care provide? Executive care nurses&nbsp;are fully qualified and trained in the provision of elderly care. Clients can expect a detailed care plan which is tailored specifically to suit our clients\' medical needs to help maintain as high a level of independence as possible. Residents can expect 24 hour assistance with the following: Washing &amp; bathing Dressing Getting in and out of bed Eating meals Using the bathroom Taking Medication Making drinks and snacks The above are just a few types of the help that Executive Care gives. Residents can expect to live in comfortable environment where they can feel at home, have their meals freshly prepared and laundry and cleaning taken care of. Above all, carers and nurses are there not just to deliver personal care, but to support our residents\' social and emotional needs, so their lives are enhanced instead of feeling lonely or isolated. What is dementia? The term dementia is a broad term used to describe a range of symptoms that can occur when the brain is affected by specific diseases and neurological conditions. These include, Alzheimers disease, vascular disease, Lewy Bodies and Frontal Temporal Dementia, Huntingtons disease, Picks disease, Parkinsons disease.&nbsp;&nbsp; The diseases and conditions that cause dementia are progressive and this means that the symptoms will get worse over time.&nbsp; The presence of dementia symptoms will vary depending on the disease process and how these impacts on the individual so each persons experience of dementia will be different. What are the challenges of caring for someone with dementia? Symptoms will usually have been present for at least 6 months with the possibility of the cause of these being as a result of an underlying treatable condition ruled out prior to a diagnosis of a dementia being confirmed.&nbsp; These symptoms are as a result of the changes that are occurring in the brain and may include loss of memory for familiar names, faces and places. The parts of the brain that control emotions and mood can be affected by the disease as can language which can affect a persons ability to talk, read or write. What does Executive Care provide? At Executive Care Group, we recognise that many factors influence the course and experience of dementia, not least the influence of the quality of care and support and the environment in which it is provided.&nbsp; Our approach seeks to maintain for as long as possible the individuals skills and abilities that enhance well being and individual autonomy for the person.&nbsp; Emphasis is given to seeing and knowing the person living with dementia because it is only by truly seeing and knowing the individual that we can recognise and respond to their needs. This is achieved through the mutual support and benefits that are derived from the shared care relationship developed with relatives and friends of the person with dementia. By listening, accepting and understanding the past and present experience of the person with dementia, we can help to maintain the individuals sense of self, and of being valued as a person.&nbsp; This knowledge can help minimise some of the stress and anxiety the symptoms of dementia cause by providing a means of diverting attention onto more comforting thoughts or activity to alleviate any distress and enhance well-being. As well as Elderly Care, Executive Care also specialises in the provision of long term healthcare for young people and adults, aged 18+, with physical and/or learning disabilities. People with physical and&nbsp;learning disabilities have their own specific needs; Executive Care aim to support development and positive life experiences through person-centred planning and review. An empowering and inclusive approach is integral to our bespoke model of&nbsp;personal&nbsp;service delivery. Throughout our specialist care homes, we are able to support people with mild, moderate or severe learning disabilities, who may have; Conditions spanning the autistic spectrum Co-presenting mental health problems Personality disorder Physical disabilities Complex needs Homes that exclusively cater for this care category are:&nbsp;Conifer Lodge,&nbsp;Evergreens Care Home,&nbsp;Heather House,&nbsp;Pembroke Lodge&nbsp;and&nbsp;Sovereign Court. Each of these homes have facilities&nbsp;to suit a range of healthcare needs. Executive Care\'s vision is to provide comfortable homes of the highest standards and specificatiosn to improve the quality of life for the individuals and families whom entrust us with their care. To fulfil this purpose, we profoundly beleive that our programme of life-enahancing and meaningful activities developed through and inclusive person-centred planning process will deliver real quality improvements on day to day life. We consistently deliver out quality driven setvices within our elderly, nursing, dementia and specialist homes through a highly and appropriately skilled workforce. We aim to recruit the right people , and develop and support them through training and leadership so that they can make a positive difference to others. Our care Resident Care Nursing Care Memory Care Physical and Learning Disability Care Our Care ','language: navigation_title: navigation_target: navigation_exclude: navigation_name:Our Care '),
