	(153,'/vacancy/chef-abbeyvale','object','object','Vacancy',1,1442418045,1442849813,2,2,'ID: 153  \nPath: /vacancy/chef-abbeyvale  \n/carehomes/abbeyvale-care-centre 42 Continental Part-Time Nov 23, 2016 1:00:00 AM Home Manager Cooking high quality food for residents with a variety of different dietary needs Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum. Activities:&nbsp; Help Clients to socialise within the Care Centre, and provide a variety of activities that cater for all tastes.&nbsp; Plan and initiate monthly rolling / individual programmes, and encourage Clients to maintain pre-existing hobbies.&nbsp; Encourage Staff Members, Relatives and Friends to participate in the Care Centre&#39;s activities.&nbsp; Accompany Clients, where possible, to off-site activities, which may occasionally take place outwith normal working hours.&nbsp; Help to create an atmosphere that suits individual Clients within the Care Centre.&nbsp; Assist with fund raising, and budgeting, for entertainments, materials and outings.&nbsp; Maintain full and accurate records of daily activities using appropriate documentation, and assist the Named Carer to review and update Client Care Files.&nbsp; &nbsp; Communication:&nbsp; Discuss the aims and objectives of recreation therapy with other Staff Members.&nbsp; Report any changes in Clients&#39; physical or emotional condition to the Home Manager or Person in Charge.&nbsp; Provide comfort and company, on a one to one basis, for Clients who are unable to undertake any form of activity.&nbsp; Arrange / participate in Staff and Client meetings, as and when required.&nbsp; Human Resources (HR):&nbsp; Assist the Home Manager when interviewing relevant Volunteers and assistant Staff Members, and supervise their work, in line with the Company&rsquo;s policies and procedures.&nbsp; &nbsp; Marketing:&nbsp; Actively market the Care Centre and promote a positive personal / professional profile within the local community, ensuring the good reputation of the Care Centre at all times.&nbsp; &nbsp; Training &amp; Development:&nbsp; Ensure all Staff Members know how to use appropriate equipment.&nbsp; Attend mandatory training days/courses, on or off site, as and when required.&nbsp; Maintain professional knowledge and competence.&nbsp; &nbsp; Health &amp; Safety:&nbsp; Report immediately to the Home Manager, or Person in Charge, any illness of an infectious nature or accident incurred by a Client, colleague, self or another.&nbsp; Understand and ensure the implementation of the Care Centre&rsquo;s Health and Safety policy, and Emergency and Fire procedures.&nbsp; Report to the Home Manager, or the Handyperson, any faulty appliances, damaged furniture, equipment or any potential hazard.&nbsp; Promote safe working practice in the Care Centre.&nbsp; &nbsp; General:&nbsp; Ensure that all information of confidential nature gained in the course of duty is not divulged to third parties.&nbsp; Notify the Home Manager, or the Person in Charge, as soon as possible of your inability to work, and also on your return to work from all periods of absence.&nbsp; Ensure the security of the Care Centre is maintained at all times.&nbsp; Adhere to all Company policies and procedures within the defined timescales.&nbsp; Ensure all equipment is clean and well maintained.&nbsp; Carry out any other tasks that may be reasonably assigned to you.&nbsp; asset:/php-developer-jd-and-ps.pdf /roles/chef ',''),
